import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

const NominatorDashboard = () => {
  const [nominees, setNominees] = useState([]);

  useEffect(() => {
    axios.get('http://127.0.0.1:5000/nominee/dashboard')
      .then(response => {
        setNominees(response.data.all_nominees_nominator);
      })
      .catch(error => {
        console.error('Error fetching nominees:', error);
      });
  }, []);

  return (
    <div>
      <header>
        <div className="navbar navbar-dark bg-dark box-shadow">
          <div className="container d-flex justify-content-between">
            <a href="#" className="navbar-brand d-flex align-items-center">
              <strong>Welcome: {sessionStorage.getItem('full_name')}</strong>
            </a>
          </div>
        </div>
      </header>
      <main role="main">
        <div className="album py-5 bg-light">
          <div className="container">
            <div>
              <Link to="/nominee/new" className="text-success">+ New Nominee Form</Link>
            </div>
            <div className="col-md-4">
              <Link to="/dashboard" className="text-warning">Back</Link>
              <Link to="/user/logout" className="text-danger">Logout</Link>
            </div>
            <div className="row">
              <table className="table">
                <thead>
                  <tr>
                    <th>Nominee Name</th>
                    <th>Nominator</th>
                    <th>Actions</th>
                  </tr>
                </thead>
                <tbody>
                  {nominees.map(nominee => (
                    <tr key={nominee.id}>
                      <td>{nominee.full_name}</td>
                      <td>{nominee.nominator.full_name}</td>
                      <td>
                        <Link to={`/nominee/${nominee.id}/edit`}>Edit</Link>
                        <Link className="text-danger" to={`/nominee/${nominee.id}/delete`}>Delete</Link>
                        <Link to={`/nominee/${nominee.id}/info`}>View</Link>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </main>
    </div>
  );
};

export default NominatorDashboard;
